import React from "react";
import { Activities, SideBar } from "../components";

function Home() {
	return (
		<div className="min-h-[100vh] grid grid-cols-2 w-full">
			<SideBar />

			<div className="w-full">
				<Activities />
			</div>
		</div>
	);
}

export default Home;
